const Construction6 = () => {
    const logodesigns = [
        { imgsrc: '../assets/Bosch.png' },
        { imgsrc: '../assets/dorset.png' },
        { imgsrc: '../assets/asianpaints.png' },
        { imgsrc: '../assets/Hettich.png' },
        { imgsrc: '../assets/Siemens.png' }
    ];

    return (
        <div>
            <div className={styles.construction6}>
                <h1>Our Trusted partners</h1>
                <p>Great collaborations that produce great designs</p>
                <div className={styles.logoSlider}>
                    {logodesigns.map((logo, index) => (
                        <img key={index} src={logo.imgsrc} alt="Partner logo" />
                    ))}
                </div>
            </div>
        </div>
    );
}

export default Construction6;
